    ########## Time Limit Exceeded ##########

    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        if 0 == len(s):
            return 0

        chars = dict()
        j = 0 # position where start
        max_sequexce_length = 0

        for i in range(len(s)):
            if chars.has_key(s[i]):
                j = max(j, chars.get(s[i]) + 1)

            chars[s[i]] = i
            max_sequexce_length = max(max_sequexce_length, i-j+1) # i:current position, j: start position

        return max_sequexce_length


